<template>
  <div>
    <msg :title="$t('Yeah! You make it')" :description="$t('Msg description')" :buttons="buttons" :icon="icon"></msg>
  </div>
</template>

<script>
  import {Msg, Divider, XButton} from '@/components'

  export default {
    components: {
      Msg,
      Divider,
      XButton
    },
    methods: {
      changeIcon() {
        if (!this.icon || this.icon === 'success') {
          this.icon = 'warn'
          return
        }
        if (this.icon === 'warn') {
          this.icon = 'info'
          return
        }
        if (this.icon === 'info') {
          this.icon = 'success'
          return
        }
      }
    },
    data() {
      return {
        description: 'msg description',
        icon: '',
        buttons: [{
          type: 'primary',
          text: 'Primary button',
          onClick: this.changeIcon.bind(this)
        }, {
          type: 'default',
          text: 'Secondary button',
          link: '/demo'
        }]
      }
    }
  }
</script>

